import React from 'react';

function Presets({ presets }) {
  return (
    <div id="presets">
      {presets.map((preset, index) => (
        <button key={index} onClick={() => window.SelectPreset(preset)}>
          {preset.name}
        </button>
      ))}
      <div className="clear"></div>
    </div>
  );
}

export default Presets;
